import React from "react"

function ProductsBlock({name, price, imageUrl, types, sizes}) {
  return (
    <div className="block-cards">
      <div className="item-card">
        {
          items.map((obj) => 
          <ProductsBlock 
          key = {obj.id}
          {...obj}/>)
        }
      </div>
    </div>
  )
}

export default ProductsBlock
